function ChangeToSlug(str) {
    str = str.toLowerCase();
    str = str.replace(/(||||||||||||||||)/g, 'a');
    str = str.replace(/(||||||||||)/g, 'e');
    str = str.replace(/(||||)/g, 'i');
    str = str.replace(/(||||||||||||||||)/g, 'o');
    str = str.replace(/(||||||||||)/g, 'u');
    str = str.replace(/(||||)/g, 'y');
    str = str.replace(/()/g, 'd');
    str = str.replace(/([^0-9a-z-\s])/g, '');
    str = str.replace(/(\s+)/g, '-');
    str = str.replace(/^-+/g, '');
    str = str.replace(/-+$/g, '');
    return str;
}

function ChangeToSlugSearch(str) {
    str = str.toLowerCase().trim();
    str = str.replace(/(||||||||||||||||)/g, 'a');
    str = str.replace(/(||||||||||)/g, 'e');
    str = str.replace(/(||||)/g, 'i');
    str = str.replace(/(||||||||||||||||)/g, 'o');
    str = str.replace(/(||||||||||)/g, 'u');
    str = str.replace(/(||||)/g, 'y');
    str = str.replace(/()/g, 'd');
    str = str.replace(/([^0-9a-z-\s])/g, '');
    str = str.replace(/(\s+)/g, ' ');
    str = str.replace(/^-+/g, '');
    str = str.replace(/-+$/g, '');
    return str;
}

function ktanh(file) {
    chonfile = file;
    var fileIn = file[0];
    if (fileIn.files === undefined || fileIn.files.length == 0) {
        call_noti('Cha chn file nh!', 'error');
        chonfile.val(null);
        return false;
    } else {
        file = fileIn.files[0];
        type = file.type;
        size = file.size;
        if (size < filesizeup) {
            if (type == "image/jpg" || type == "image/jpeg" || type == "image/png" || type == "image/gif") {
                return true;
            } else {
                call_noti('Vui lng chn 1 file nh!', 'error');
                chonfile.val(null);
                return false;
            }
        } else {
            call_noti('Dung lng file nh hn 3MB!', 'error');
            chonfile.val(null);
            return false;
        }
    }
}

function ktcv(file) {
    chonfile = file;
    var fileIn = file[0];
    if (fileIn.files === undefined || fileIn.files.length == 0) {
        if (typeof file.attr('required') === "undefined") {
            return true;
        } else {
            call_noti('Vui lng upload file h s', 'error');
            chonfile.val(null);
            return false;
        }
    } else {
        file = fileIn.files[0];
        type = file.type;
        size = file.size;
        if (size < hssizeup) {
            if (type == "image/jpg" || type == "image/jpeg" || type == "image/png" || type == "image/gif" || type == "application/msword" || type == "application/vnd.openxmlformats-officedocument.wordprocessingml.document" || type == "application/pdf") {
                return true;
            } else {
                call_noti('File khng ng nh dng!', 'error');
                chonfile.val(null);
                return false;
            }
        } else {
            call_noti('Dung lng file nh hn 3MB!', 'error');
            chonfile.val(null);
            return false;
        }
    }
}

function format1(n, currency) {
    return currency + n.toFixed(0).replace(/./g, function(c, i, a) {
        return i > 0 && c !== "." && (a.length - i) % 3 === 0 ? "." + c : c;
    });
}

function tien(str) {
    str = str.replace(/[^0-9]/g, '');
    str = str.toString().replace(/\B(?=(\d{3})+(?!\d))/g, ".");
    return str;
}

function cuon(phantu, plus) {
    $('html, body').animate({
        scrollTop: (phantu.offset().top) - plus
    }, 1000)
}

function parseDate(str) {
    var mdy = str.split('/');
    return new Date(mdy[2], mdy[0] - 1, mdy[1]);
}

function daydiff(first, second) {
    return (second - first) / (1000 * 60 * 60 * 24)
}

function btnlinkload(elm, text, onlyIcon) {
    if (!text || text == "") {
        if (onlyIcon)
            text = '<i class="fas fa-spinner fa-spin"></i>';
        else
            text = 'Loading... <i class="fas fa-spinner fa-spin"></i>';
    }
    elm.attr("data-textLoading", elm.html());
    elm.html(text);
    elm.prop("disabled", true);
    elm.addClass("disabled");
}

function btnlinkthanhcong(elm, text) {
    if (text) {
        elm.html(text);
    } else {
        text2 = elm.attr("data-textLoading");
        if (text2) {
            elm.html(text2);
            elm.attr("data-textLoading", "");
        } else {
            elm.html("Submit");
        }
    }
    elm.prop("disabled", false);
    elm.removeClass("disabled");
}

function isset(key, array) {
    ret = false;
    array.forEach(function(entry) {
        if (entry == key) {
            ret = true;
        }
    });
    return ret;
}

function in_array(needle, haystack) {
    for (var key in haystack) {
        if (needle === haystack[key]) {
            return true;
        }
    }
    return false;
}

function ngayoutput(strDate, format) {
    if (!isNaN(strDate)) {
        strDate = strDate * 1000;
    } else {
        strDate = strDate.replace(" ", "T");
    }
    let date = new Date(strDate);
    if (!(date instanceof Date)) {
        return 'NaN';
    }
    let timezone = -(date.getTimezoneOffset() / 60);
    let year = date.getUTCFullYear();
    let yearShort = year % 100;
    let month = date.getUTCMonth() + 1;
    if (month < 10)
        month = "0" + month;
    let day = date.getUTCDate();
    if (day < 10)
        day = "0" + day;
    let hours = date.getUTCHours() + timezone;
    if (hours < 10)
        hours = "0" + hours;
    let minutes = date.getUTCMinutes();
    if (minutes < 10)
        minutes = "0" + minutes;
    let seconds = date.getUTCSeconds();
    if (seconds < 10)
        seconds = "0" + seconds;
    if (!format) {
        format = "d-m-Y H:i:s";
    }
    return format.replace("d", day).replace("m", month).replace("y", yearShort).replace("Y", year).replace("H", hours).replace("i", minutes).replace("s", seconds);
}

