function time_elapsed_string(input) {
    if (!isNaN(input)) {
        input = input * 1000;
    } else {
        input = input.replace(" ", "T");
    }
    let date = new Date(input);
    let current = new Date();
    if (!(date instanceof Date)) {
        return 'NaN';
    }
    var seconds = Math.floor((current.getTime() - date.getTime()) / 1000);
    var interval = seconds / 31536000;
    if (interval > 1) {
        return Math.floor(interval) + " nm trc";
    }
    interval = seconds / 2592000;
    if (interval > 1) {
        return Math.floor(interval) + " thng trc";
    }
    interval = seconds / 86400;
    if (interval > 1) {
        return Math.floor(interval) + " ngy trc";
    }
    interval = seconds / 3600;
    if (interval > 1) {
        return Math.floor(interval) + " gi trc";
    }
    interval = seconds / 60;
    if (interval > 1) {
        return Math.floor(interval) + " pht trc";
    }
    if (seconds > 5) {
        return Math.floor(seconds) + " giy trc";
    } else {
        return "Vi giy trc";
    }
}

function isDate(strDate) {
    if (strDate instanceof Date) {
        return true;
    } else {
        if (!isNaN(strDate)) {
            strDate = strDate * 1000;
        } else {
            strDate = strDate.replace(" ", "T");
        }
        let date = new Date(strDate);
        if (date instanceof Date) {
            return true
        } else {
            return false;
        }
    }
}

