    renderNopHoSo = function(tuyendung_id) {
        if (usrType == 5) {
            $.post(URL_ROOT + "api/tuyendung/renderNopHoSo", {
                'tuyendung_id': tuyendung_id
            }, function(r) {
                if (r.status == 1) {
                    $("#modalFullPublic").modalFull('show');
                    let html = `<div class="nopHoSoContent">${r.data}</div>`;
                    $('#modalFullPublic').setContentHtml(html);
                    renderCaptcha($("#frmNopHS .g-recaptcha"));
                } else if (r.status == 2) {
                    let comfirm = confirm(r.message);
                    if (comfirm == true) {
                        $("#modalFullPublic").modalFull('show');
                        let html = `<div class="nopHoSoContent">${r.data}</div>`;
                        $('#modalFullPublic').setContentHtml(html);
                        renderCaptcha($("#frmNopHS .g-recaptcha"));
                    } else {
                        location.reload();
                    }
                } else {
                    call_noti(r.message, 'error', 3000);
                }
            }, "JSON").fail(function() {
                $('#modalPublic').modal('hide');
            });
        } else if (usrType > 0) {
            call_noti('Phi ng nhp ng vin', 'error', 3000);
            $("#modalFullPublic").modalFull('hide');
        } else {
            call_noti('Phi ng nhp ng vin', 'error', 3000);
            $("#modalFullPublic").modalFull('hide');
            $('.showFormUngVien').trigger('click');
        }
    };

    function renderTinHoc(num) {
        let strTH = "";
        let numStar = 6 - parseInt(num);
        strTH += "<div class='rating'>";
        for (let i = 1; i <= 5; i++) {
            if (i <= numStar) {
                cls = 'fas fa-star';
            } else {
                cls = 'far fa-star';
            }
            strTH += "<span class='" + cls + "'></span>";
        }
        strTH += "</div>";
        return strTH;
    }
