$(document).ready(function() {
    initSwiper = function(elm) {
        let container = elm.find('[data-swiper="container"]').attr('id');
        let initID = '#' + container;
        let items = elm.data('items');
        let autoplay = elm.data('autoplay');
        let speed = elm.data('speed');
        let pagination = elm.find('.swiper-pagination');
        let prev = elm.find('.swiper-button-prev');
        let next = elm.find('.swiper-button-next');
        let direction = elm.data('direction');
        let loop = elm.data('loop');
        let spaceBetWeen = elm.data('spacebetween');
        let effect = elm.data('effect');
        let initial = elm.data('initial');
        let center = elm.data('center');
        let hoverPause = elm.data('hoverpause');
        let autoHeight = elm.data('autoheight');
        let disableOnInteraction = $(this).data('disableoninteraction');
        let conf = {};
        if (items) {
            conf.slidesPerView = items;
        }
        if (typeof autoplay === 'number') {
            conf.autoplay = {
                delay: autoplay,
            };
        }
        if (speed) {
            conf.speed = speed;
        }
        if (initial) {
            conf.initialSlide = initial;
        }
        if (center) {
            conf.centeredSlides = center;
        }
        if (loop) {
            conf.loop = loop;
        }
        if (effect) {
            conf.effect = effect;
        }
        if (direction) {
            conf.direction = direction;
        }
        if (autoHeight) {
            conf.autoHeight = autoHeight;
        }
        if (prev && next) {
            conf.navigation = {
                nextEl: initID + ' .swiper-button-next',
                prevEl: initID + ' .swiper-button-prev',
            };
        }
        if (pagination) {
            conf.pagination = {
                el: initID + ' .swiper-pagination',
                type: 'bullets',
                clickable: true
            };
        }
        if (spaceBetWeen) {
            conf.spaceBetween = spaceBetWeen;
        }
        if (disableOnInteraction) {
            conf.disableOnInteraction = disableOnInteraction;
        }
        conf.lazy = true;
        conf.preloadImages = false;

        function animated_swiper(selector, initSwip) {
            let animated = function animated() {
                $(selector + ' [data-animate]').each(function() {
                    let anim = $(this).data('animate');
                    let delay = elm.data('delay');
                    let duration = $(this).data('duration');
                    $(this).removeClass('anim' + anim).addClass(anim + ' animated').css({
                        webkitAnimationDelay: delay,
                        animationDelay: delay,
                        webkitAnimationDuration: duration,
                        animationDuration: duration
                    }).one('webkitAnimationEnd mozAnimationEnd MSAnimationEnd oanimationend animationend', function() {
                        $(this).removeClass(anim + ' animated');
                    });
                });
            };
            animated();
        }

        function pauseAutoPlayOnHover(selector, initSwip) {
            $(selector).on('mouseover', function() {
                initSwip.autoplay.stop();
            });
            $(selector).on('mouseout', function() {
                initSwip.autoplay.start();
            });
        }
        if (container) {
            let initSwip = new Swiper(initID, conf);
            animated_swiper(initID, initSwip);
            if (hoverPause)
                pauseAutoPlayOnHover(initID, initSwip);
        }
    };
    $('[data-carousel="swiperSlider"]').each(function() {
        initSwiper($(this));
    });
    $('[data-toggle="tooltip"]').tooltip({
        animated: 'fade',
        placement: 'top',
        container: 'body'
    });
    $("select.select2").each(function() {
        let elm = '';
        if (typeof $(this).data('wrapper') !== 'undefined') {
            elm = $(this).parent();
        }
        $(this).select2({
            templateResult: function(data, container) {
                if (data.element) {
                    $(container).addClass($(data.element).attr("class"));
                }
                return data.text;
            },
            dropdownParent: elm,
            minimumResultsForSearch: 10,
            language: {
                maximumSelected: function(e) {
                    let t = "Ch c chn " + e.maximum + " la chn";
                    return t;
                }
            },
            placeholder: 'Chn danh mc',
        });
    });
    $('.form-input-animation input, .form-textarea-animation textarea').blur(function() {
        if ($(this).val() != "") {
            $(this).addClass("valid");
        } else {
            $(this).removeClass("valid");
        }
    });

    function copyClipBoard(href) {
        let createTextarea = document.createElement('textarea');
        createTextarea.style.cssText = 'position: absolute; left: -99999px';
        createTextarea.setAttribute("id", "textareaCopy");
        document.body.appendChild(createTextarea);
        let textareaElm = document.getElementById('textareaCopy');
        textareaElm.value = href;
        textareaElm.select();
        textareaElm.setSelectionRange(0, 99999);
        let status = document.execCommand("copy");
        if (status) {
            call_noti("Copy link thnh cng", 'success', '1500', "toast-top-full-width");
        }
        textareaElm.remove();
    }
    $(document).on("click", ".copyLink", function() {
        copyClipBoard($(this).data('href'));
    });
    $(document).on("click", ".shareFacebook", function() {
        let href = $(this).data('href');
        let linkShare = "https://www.facebook.com/sharer/sharer.php?u=" + href + "&display=popup&ref=plugin&src=like&kid_directed_site=0";
        popupCenter(linkShare, 'Cha s facebook', '614', '600', 0, 0);
    });
    $(document).on('click', '.expanded-button', function() {
        $(this).closest('.expanded-list').find('.expanded-item').slideToggle(250);
        $(this).parent().remove();
    });
});

